Novak Djokovic, a new #HublotAmbassador!

@djokernole needs no introduction – his record speaks for itself. The Serbian tennis player has simply won everything. Already a living legend, but still at the top of his game, #NovakDjokovic has officially joined the Hublot family of inspiring ambassadors.

This is a great source of pride for Hublot, which welcomes the man who proves himself day after day as one of the greatest tennis players of all time. Game, set, match for “Nole” and Hublot! #HublotLovesTennis
